import reactDom from "react-dom";
import React from "react";
import { HashRouter as Router, Route } from 'react-router-dom';
import Navigation from "./Navigation";
import Auction from "../route/Auction";

const AppRouter = () => {
    return (
        <Router>
            <Navigation />
            <Route path='/auction'>
                <Auction />
            </Route>
        </Router>
    )
}

export default AppRouter;
